import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container,
  CssBaseline,
  Box,
  Typography,
  Paper,
  ThemeProvider,
  createTheme,
  useMediaQuery,
  AppBar,
  Toolbar,
  IconButton,
  Switch,
  FormControlLabel,
  Snackbar,
  Alert,
  Link
} from '@mui/material';
import LightModeIcon from '@mui/icons-material/LightMode';
import DarkModeIcon from '@mui/icons-material/DarkMode';
import GitHubIcon from '@mui/icons-material/GitHub';
import BettingForm from './components/BettingForm';
import ResultsDisplay from './components/ResultsDisplay';

function App() {
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const prefersDarkMode = useMediaQuery('(prefers-color-scheme: dark)');
  const [darkMode, setDarkMode] = useState(prefersDarkMode);
  
  useEffect(() => {
    setDarkMode(prefersDarkMode);
  }, [prefersDarkMode]);

  const theme = createTheme({
    palette: {
      mode: darkMode ? 'dark' : 'light',
      primary: {
        main: darkMode ? '#90caf9' : '#1976d2',
      },
      secondary: {
        main: darkMode ? '#f48fb1' : '#dc004e',
      },
      background: {
        default: darkMode ? '#121212' : '#f5f5f5',
        paper: darkMode ? '#1e1e1e' : '#ffffff',
      },
      success: {
        main: '#4caf50',
      },
      error: {
        main: '#f44336',
      },
      warning: {
        main: '#ff9800',
      },
    },
    shape: {
      borderRadius: 8,
    },
    typography: {
      fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
      h1: {
        fontWeight: 700,
      },
      h2: {
        fontWeight: 700,
      },
      h3: {
        fontWeight: 600,
      },
      h4: {
        fontWeight: 600,
      },
      h5: {
        fontWeight: 500,
      },
      h6: {
        fontWeight: 500,
      },
    },
    components: {
      MuiCard: {
        styleOverrides: {
          root: {
            boxShadow: darkMode ? '0 4px 20px rgba(0,0,0,0.15)' : '0 4px 20px rgba(0,0,0,0.05)',
            transition: 'all 0.3s ease-in-out',
            '&:hover': {
              transform: 'translateY(-4px)',
              boxShadow: darkMode ? '0 8px 30px rgba(0,0,0,0.25)' : '0 8px 30px rgba(0,0,0,0.1)',
            },
          },
        },
      },
      MuiButton: {
        styleOverrides: {
          root: {
            textTransform: 'none',
            borderRadius: 6,
          },
        },
      },
    },
  });

  const handleSubmit = async (formData) => {
    setLoading(true);
    setError(null);
    
    try {
      const response = await axios.post('/api/calculate-ev', formData);
      setResults(response.data);
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to calculate EV. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const fetchOdds = async (params) => {
    try {
      const response = await axios.get('/api/odds', { params });
      return response.data;
    } catch (error) {
      throw error;
    }
  };

  const fetchEvents = async (sport) => {
    try {
      const response = await axios.get('/api/events', { params: { sport } });
      return response.data;
    } catch (error) {
      throw error;
    }
  };

  const handleCloseError = () => {
    setError(null);
  };

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="static" color="primary" elevation={0}>
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Cashout Calculator
          </Typography>
          <FormControlLabel
            control={
              <Switch
                checked={darkMode}
                onChange={toggleDarkMode}
                icon={<LightModeIcon />}
                checkedIcon={<DarkModeIcon />}
              />
            }
            label={darkMode ? 'Dark' : 'Light'}
          />
          <IconButton
            color="inherit"
            href="https://github.com/yourusername/cashout-calculator"
            target="_blank"
            rel="noopener noreferrer"
          >
            <GitHubIcon />
          </IconButton>
        </Toolbar>
      </AppBar>
      <Container maxWidth="md">
        <Box sx={{ my: 4 }}>
          <Paper elevation={3} sx={{ p: 3, mb: 4 }}>
            <Typography variant="h4" component="h1" gutterBottom align="center">
              Expected Value Cashout Calculator
            </Typography>
            <Typography variant="body1" paragraph align="center">
              Make informed cashout decisions by calculating the expected value (EV) of your bets.
            </Typography>
            <BettingForm
              onSubmit={handleSubmit}
              fetchOdds={fetchOdds}
              fetchEvents={fetchEvents}
              loading={loading}
            />
          </Paper>

          {results && (
            <Paper elevation={3} sx={{ p: 3 }}>
              <ResultsDisplay results={results} />
            </Paper>
          )}
        </Box>
        <Box sx={{ mt: 4, mb: 2, textAlign: 'center' }}>
          <Typography variant="body2" color="text.secondary">
            Â© {new Date().getFullYear()} Cashout Calculator | 
            <Link href="https://github.com/yourusername/cashout-calculator" target="_blank" sx={{ ml: 1 }}>
              GitHub
            </Link>
          </Typography>
        </Box>
      </Container>
      <Snackbar open={!!error} autoHideDuration={6000} onClose={handleCloseError}>
        <Alert onClose={handleCloseError} severity="error">
          {error}
        </Alert>
      </Snackbar>
    </ThemeProvider>
  );
}

export default App;
